Util.bresenham = function(x1,y1,x2,y2) {
	var x = x2 - x1;
	var dx = x < 0 ? -x : x;
	var sx = x1 < x2 ? 1 : -1;
	var x = y2 - y1;
	var dy = -(x < 0 ? -x : x);
	var sy = y1 < y2 ? 1 : -1;
	var error = dx + dy;
	var ans = [];
	while(true) {
		ans.push({ x : x1, y : y1});
		if(x1 == x2 && y1 == y2) {
			break;
		}
		var e2 = 2 * error;
		if(e2 >= dy) {
			if(x1 == x2) {
				break;
			}
			error += dy;
			x1 += sx;
		}
		if(e2 <= dx) {
			if(y1 == y2) {
				break;
			}
			error += dx;
			y1 += sy;
		}
	}
	return ans;
};
Util.rasterPolygon = function(points) {
	var lines = [];
	var edges = [];
	var _g = 0;
	var _g1 = points.length;
	while(_g < _g1) {
		var i = _g++;
		var p1 = points[i];
		var p2 = i == points.length - 1 ? points[0] : points[i + 1];
		var p1p2 = Util.bresenham(p1.x,p1.y,p2.x,p2.y);
		edges = edges.concat(p1p2);
	}
	var yToXs = new haxe_ds_IntMap();
	var _g = 0;
	while(_g < edges.length) {
		var point = edges[_g];
		++_g;
		var s = yToXs.h[point.y];
		if(s != null) {
			s.push(point.x);
		} else {
			yToXs.h[point.y] = [point.x];
		}
	}
	var key = yToXs.keys();
	while(key.hasNext()) {
		var key1 = key.next();
		var arr = yToXs.h[key1];
		var mini = arr[0];
		var maxi = arr[0];
		var _g = 0;
		while(_g < arr.length) {
			var x = arr[_g];
			++_g;
			if(x < mini) {
				mini = x;
			}
			if(x > maxi) {
				maxi = x;
			}
		}
		lines.push({ y : key1, x1 : mini, x2 : maxi});
	}
	return lines;
};
